import Wrapper from "../assets/wrappers/Navbar";
import { FaHome } from "react-icons/fa";

const Navbar = () => {
  return (
    <Wrapper>
      <h4>Navbar</h4>
      <FaHome />
    </Wrapper>
  );
};
export default Navbar;
